		flir_conf.flir_sys_Reticle[0] = (int)((int)((datatemp[3])>>24)-50);   // Reticle XÖáÆ«ÒÆ    ¶ÌÖá  ¶Ô½¹×¼ÐÄÔÚÆÁÄ»ÉÏµÄÎ»ÖÃ
		flir_conf.flir_sys_Reticle[1] = (int)((int)((datatemp[4])>>24)-50);   // Reticle YÖáÆ«ÒÆ    ³¤Öá
		
		flir_conf.flir_sys_DisMode = (DisplayMode_sta)(datatemp[5]>>24);      // ÉãÏñÍ·Êý¾ÝÏÔÊ¾Ä£Ê½£¨²ÊÉ«/ºÚ°×£©
		flir_conf.flir_sys_ComMode = (CompassMode_sta)(datatemp[6]>>24);      // Ö¸ÄÏÕë¹¦ÄÜÊÇ·ñ¿ªÆô
		flir_conf.file_sys_PBWakeup= (PBWakeup_sta)(datatemp[7]>>24);         // ÊÇ·ñÎªPBSTA¿ª»ú»½ÐÑ
		flir_conf.file_sys_LowPower= (LowPower_sta)(datatemp[8]>>24);         // ±ê¼ÇÏµÍ³µ±Ç°×´Ì¬£ºStop Mode / Running
